لت الدخول إلى YouTube. يشمل ذلك المنتجات التي تبحث عنها أو تلك المُشار إليها في الفيديوهات أو المنتجات ذات الصلة. ","textColor":4294967295},{"text":"مزيد من المعلومات","navigationEndpoint":{"clickTrackingParams":"COIDEMdVIhMI-_zMn-b3hgMVgMVJBx2a3Q1A","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nيحدّد التجّار معلومات المنتجات والأسعار النهائية، وهي قابلة للتغيير. وقد يتمّ تحصيل رسوم إضافية منك متفاوتة القيمة، مثل رسوم الشحن والمناولة. يمكنك النقر على المنتجات أدناه أو الانتقال إلى متجر التاجر لإجراء عملية شراء والحصول على المزيد من المعلومات، بما في ذلك توفُّر المنتج والسعر النهائي الذي سيحصّله التاجر. تشمل الأسعار ضريبة القيمة المُضافة عند انطباقها.\n\nإنّ المنتجات المُشار إليها بأنّها \"عرض حصري للقناة\" تُعدّ بيانات منتجات قد شاركها تاجر حصريًا مع قناة محددة على YouTube. وتكون هذه المنتجات بسعر مخفَّض و/أو متوفرة لفترة محدودة وفقًا لأحكام التاجر وشروطه. يحدّد التاجر السعر النهائي وشروط الشراء ويكون مسؤولاً عنهما. ","textColor":4294967295},{"text":"مزيد من المعلومات","navigationEndpoint":{"clickTrackingParams":"COIDEMdVIhMI-_zMn-b3hgMVgMVJBx2a3Q1A","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nلا تتحمّل YouTube أي مسؤولية عن منتجات التجّار أو معلومات المنتجات التي يقدمّونها. ولا تتحمّل YouTube كذلك أي مسؤولية عن أنشطتك وعمليات الشراء التي تُجريها لدى التجّار (بما في ذلك تلك التي تُجريها من خلال الروابط أدناه). تخضع هذه الأنشطة وعمليات الشراء للأحكام والشروط الخاصة بكل تاجر (بما في ذلك سياسة الخصوصية التي يتّبعها). تتوفّر مراجعات المنتجات في مواقع جغرافية معيّنة فقط، ولا تتحمّل Google مسؤولية إثبات صحة هذه المراجعات. ","textColor":4294967295},{"text":"مزيد من المعلومات","navigationEndpoint":{"clickTrackingParams":"COIDEMdVIhMI-_zMn-b3hgMVgMVJBx2a3Q1A","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}}]},"confirmLabel":{"simpleText":"حسنًا"},"trackingParams":"COIDEMdVIhMI-_zMn-b3hgMVgMVJBx2a3Q1A"}},"popupType":"DIALOG"}},"trackingParams":"COADEJT0ARgCIhMI-_zMn-b3hgMVgMVJBx2a3Q1A"}},{"menuServiceItemRenderer":{"text":{"accessibility":{"accessibilityData":{"label":"الإبلاغ عن البيانات"}},"simpleText":"الإبلاغ عن البيانات"},"icon":{"iconType":"FLAG"},"serviceEndpoint":{"clickTrackingParams":"COEDENbYBxgGIhMI-_zMn-b3hgMVgMVJBx2a3Q1A","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/flag/get_form"}},"getReportFormEndpoint":{"params":"ygEIc2hvcHBpbmfQAQ7iAfkHCrwBCk8KCAoGTWFkRml0CgMKASwKAwoBIAoVChNSZXNpc3RhbmNlIEJhbmQgU2V0CgMKASwKAwoBIAoYChbYrC7ZhS7igI_CoOKAjzIsMTc3LjA1GmlCNlZHV0FBQUFBQUNBZ0lDd0R3QUFBY0NOdHdFQUlBQTRBWUlCRUhsdmRYUjFZbVV0YzJodmNIQnBibWV5QVJONWIzVjBkV0psTFhOb2IzQndhVzVuTFRGdzRCTHU5ZlRZMnB2NnRjY0IKxwEKWgoICgZNYWRGaXQKAwoBLAoDCgEgCiAKHkFkanVzdGFibGUgSnVtcCBSb3BlIERlZXAgVGVhbAoDCgEsCgMKASAKGAoW2Kwu2YUu4oCPwqDigI8xLDY5My4yNhppQjhSVmpBQUFBQUFDQWdJQ3dEd0FBQWNDTnR3RUFJQUE0QVlJQkVIbHZkWFIxWW1VdGMyaHZjSEJwYm1leUFSTjViM1YwZFdKbExYTm9iM0J3YVc1bkxURnc0QktidVo3SXFKcVVrWThCCsgBClsKCAoGTWFkRml0CgMKASwKAwoBIAohCh9Fc3NlbnRpYWwgRml0bmVzcyBNYXQgRGVlcCBUZWFsCgMKASwKAwoBIAoYChbYrC7ZhS7igI_CoOKAjzQsMzA1LjcxGmlCY3hHckFBQUFBQUNBZ0lDd0R3QUFBY0NOdHdFQUlBQTRBWUlCRUhsdmRYUjFZbVV0YzJodmNIQnBibWV5QVJONWIzVjBkV0psTFhOb2IzQndhVzVuTFRGdzRCS0kyc0RwamRYUy00RUIK0QEKZAoICgZNYWRGaXQKAwoBLAoDCgEgCioKKEV2ZXJ5ZGF5IERyaW5rIEJvdHRsZSBCcmlnaHQgU2FnZSAvIDMyb3oKAwoBLAoDCgEgChgKFtisLtmFLuKAj8Kg4oCPMi },"simpleText":"المنتجات"},"visibilityButton":{"buttonRenderer":{"style":"STYLE_UNKNOWN","size":"SIZE_DEFAULT","isDisabled":false,"icon":{"iconType":"CLOSE"},"accessibility":{"label":"انقر مرّتين لتصغير الصفحة"},"trackingParams":"CGoQ8FsiEwj7_Myf5veGAxWAxUkHHZrdDUA=","command":{"clickTrackingParams":"CGoQ8FsiEwj7_Myf5veGAxWAxUkHHZrdDUA=","changeEngagementPanelVisibilityAction":{"targetId":"shopping_panel_for_entry_point_5","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}}}},"trackingParams":"CFwQ040EGAQiEwj7_Myf5veGAxWAxUkHHZrdDUA="}},"content":{"productListRenderer":{"contents":[{"productListHeaderRenderer":{"title":{"runs":[{"text":"أشارت قناة \"MadFit\" إلى المنتجات أدناه."},{"text":" "},{"text":"مزيد من المعلومات","navigationEndpoint":{"clickTrackingParams":"CF0Qw9AHGAAiEwj7_Myf5veGAxWAxUkHHZrdDUA=","commandMetadata":{"webCommandMetadata":{"url":"#"}},"openPopupAction":{"popup":{"menuPopupRenderer":{"items":[{"menuNavigationItemRenderer":{"text":{"accessibility":{"accessibilityData":{"label":"لمحة عن المنتجات والعمولات"}},"simpleText":"لمحة عن المنتجات والعمولات"},"icon":{"iconType":"HELP"},"navigationEndpoint":{"clickTrackingParams":"CF0Qw9AHGAAiEwj7_Myf5veGAxWAxUkHHZrdDUA=","openPopupAction":{"popup":{"fancyDismissibleDialogRenderer":{"dialogMessage":{"runs":[{"text":"تستند المنتجات المدرَجة هنا إلى تلك المذكورة في مجموعات التسوّق أو الفيديو الذي تشاهده حاليًا أو شاهدته في السابق بعد أن سجّلت الدخول إلى YouTube. يشمل ذلك المنتجات التي تبحث عنها أو تلك المُشار إليها في الفيديوهات أو المنتجات ذات الصلة. ","textColor":4294967295},{"text":"مزيد من المعلومات","navigationEndpoint":{"clickTrackingParams":"CGkQx1UiEwj7_Myf5veGAxWAxUkHHZrdDUA=","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nيحدّد التجّار معلومات المنتجات والأسعار النهائية، وهي قابلة للتغيير. وقد يتمّ تحصيل رسوم إضافية منك متفاوتة القيمة، مثل رسوم الشحن والمناولة. يمكنك النقر على المنتجات أدناه أو الانتقال إلى متجر التاجر لإجراء عملية شراء والحصول على المزيد من المعلومات، بما في ذلك توفُّر المنتج والسعر النهائي الذي سيحصّله التاجر. تشمل الأسعار ضريبة القيمة المُضافة عند انطباقها.\n\nإنّ المنتجات المُشار إليها بأنّها \"عرض حصري للقناة\" تُعدّ بيانات منتجات قد شاركها تاجر حصريًا مع قناة محددة على YouTube. وتكون هذه المنتجات بسعر مخفَّض و/أو متوفرة لفترة محدودة وفقًا لأحكام التاجر وشروطه. يحدّد التاجر السعر النهائي وشروط الشراء ويكون مسؤولاً عنهما. ","textColor":4294967295},{"text":"مزيد من المعلومات","navigationEndpoint":{"clickTrackingParams":"CGkQx1UiEwj7_Myf5veGAxWAxUkHHZrdDUA=","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nلا تتحمّل YouTube أي مسؤولية عن منتجات التجّار أو معلومات المنتجات التي يقدمّونها. ولا تتحمّل YouTube كذلك أي مسؤولية عن أنشطتك وعمليات الشراء التي تُجريها لدى التجّار (بما في ذلك تلك التي تُجريها من خلال الروابط أدناه). تخضع هذه الأنشطة وعمليات الشراء للأحكام والشروط الخاصة بكل تاجر (بما في ذلك سياسة الخصوصية التي يتّبعها). تتوفّر مراجعات المنتجات في مواقع جغرافية معيّنة فقط، ولا تتحمّل Google مسؤولية إثبات صحة هذه المراجعات. ","textColor":4294967295},{"text":"مزيد من المعلومات","navigationEndpoint":{"clickTrackingParams":"CGkQx1UiEwj7_Myf5veGAxWAxUkHHZrdDUA=","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}}]},"confirmLabel":{"simpleText":"حسنًا"},"trackingParams":"CGkQx1UiEwj7_Myf5veGAxWAxUkHHZrdDUA="}}
